import React from 'react';
import './WebNav.scss';

const WebNav = () => {
  return (
    <div className="WebNav">
      <div className="Logo">네컷 앨범</div>
      <div className="Menu">
        <span>더보기리그</span>
        <span>주간 네컷</span>
        <span>명예의 전당</span>
      </div>
      <button className="Login">로그인</button>
    </div>
  );
};

export default WebNav;
